import React from "react";
import { CamisetaStyle } from "./style";

const buscar= () => {
    const buscarItem = props.busca
    console.log(buscarItem)
    props.setBusca("")
}

function Camisetas(props){
    return(
        <CamisetaStyle>
            {props.nome}
            {props.foto}
            {props.valor}
            {props.comprar}

        </CamisetaStyle>
    )
}

export default Camisetas
